o curso é fornecer as informações necessárias para garantir contratações de serviços e  terceirizações regulares, desde a etapa de planejamento até a etapa de gestão e fiscalização dos contratos, enfatizando-se: planejamento da terceirização e de contratações de serviços contínuos ou não ; questões a serem levadas na LDO e LOA ; trato com o Plano de Cargos e Empregos estruturados; acordo de níveis de serviço e a mensuração dos resultados; cautelas na elaboração do termo de referência; correlação entre quantidade de empregados e quantidade do serviço demandado; elaboração da planilha de custos; conta vinculada, pagamento por fato gerador; sustentabilidade; análise das propostas apresentadas na licitação; gestão e fiscalização dos contratos terceirizados, dentre outros temas, serão alguns dos pontos a serem abordados.\r\nComo os servidores do Departamento Financeiro são responsáveis pela elaboração da planilha de custos, a ementa do curso vem de encontro às demandas do departamento e será ministrado pelo professor José Carlos Baroni, advogado especializado em Direito Administrativo, contabilista e professor universitário na área de direito público; \r\nDessa forma, visando a melhoria contínua nos procedimentos da Casa, a pretendida contratação se faz necessária.\r\n</td>\r\n                            </tr>\r\n                        </table>\r\n                    </td>\r\n                </tr>\r\n                    <tr>\r\n                        <td colspan=\"2\" style=\"border:none!important;\">\r\n                            <table style=\"border:none;\">\r\n                                <tr>\r\n                                    <td style=\"text-align: right; font-weight: bold;\">\r\n                                        Piracicaba, 04 de junho de 2024\r\n                                    </td>\r\n                                </tr>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                